import { FunctionComponent, useEffect, useState } from "react";
import { getAllUsers } from "../services/usersServices";
import User from "../interfaces/User";

interface CrmProps {}

const Crm: FunctionComponent<CrmProps> = () => {
  let [users, setUsers] = useState<User[]>([]);

  useEffect(() => {
    getAllUsers()
      .then((res) => {
        console.log(res.data);
        setUsers(res.data);
      })
      .catch((err) => console.log(err));
  }, []);

  return (
    <>
      This is Crm
      {users.length ? (
        <>
          <table className="table">
            <thead>
              <th>User Id</th>
              <th>name</th>
              <th>email</th>
              <th>password</th>
              <th>Edit</th>
              <th>Delete</th>
            </thead>
            <tbody>
              {users.map((user: User) => (
                <tr key={user.userId}>
                  <td>{user.userId}</td>
                  <td>
                    {user.firstName}
                    {user.lastName}
                  </td>
                  <td>{user.email}</td>
                  <td>{user.password}</td>
                  <td>{user.userId}</td>
                  <td>{user.userId}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </>
      ) : (
        <h3>There are no users yet</h3>
      )}
    </>
  );
};

export default Crm;
